; (function () {

	'use strict';

	var isMobile = {
		Android: function () {
			return navigator.userAgent.match(/Android/i);
		},
		BlackBerry: function () {
			return navigator.userAgent.match(/BlackBerry/i);
		},
		iOS: function () {
			return navigator.userAgent.match(/iPhone|iPad|iPod/i);
		},
		Opera: function () {
			return navigator.userAgent.match(/Opera Mini/i);
		},
		Windows: function () {
			return navigator.userAgent.match(/IEMobile/i);
		},
		any: function () {
			return (isMobile.Android() || isMobile.BlackBerry() || isMobile.iOS() || isMobile.Opera() || isMobile.Windows());
		}
	};

	var mobileMenuOutsideClick = function () {

		$(document).click(function (e) {
			var container = $("#colorlib-offcanvas, .js-colorlib-nav-toggle");
			if (!container.is(e.target) && container.has(e.target).length === 0) {

				if ($('body').hasClass('offcanvas')) {

					$('body').removeClass('offcanvas');
					$('.js-colorlib-nav-toggle').removeClass('active');

				}


			}
		});

	};


	var offcanvasMenu = function () {

		$('#page').prepend('<div id="colorlib-offcanvas" />');
		$('#page').prepend('<a href="#" class="js-colorlib-nav-toggle colorlib-nav-toggle colorlib-nav-white"><i></i></a>');
		var clone1 = $('.menu-1 > ul').clone();
		$('#colorlib-offcanvas').append(clone1);
		var clone2 = $('.menu-2 > ul').clone();
		$('#colorlib-offcanvas').append(clone2);

		$('#colorlib-offcanvas .has-dropdown').addClass('offcanvas-has-dropdown');
		$('#colorlib-offcanvas')
			.find('li')
			.removeClass('has-dropdown');

		// Hover dropdown menu on mobile
		$('.offcanvas-has-dropdown').mouseenter(function () {
			var $this = $(this);

			$this
				.addClass('active')
				.find('ul')
				.slideDown(500, 'easeOutExpo');
		}).mouseleave(function () {

			var $this = $(this);
			$this
				.removeClass('active')
				.find('ul')
				.slideUp(500, 'easeOutExpo');
		});


		$(window).resize(function () {

			if ($('body').hasClass('offcanvas')) {

				$('body').removeClass('offcanvas');
				$('.js-colorlib-nav-toggle').removeClass('active');

			}
		});
	};

	var burgerMenu = function () {

		$('body').on('click', '.js-colorlib-nav-toggle', function (event) {
			var $this = $(this);


			if ($('body').hasClass('overflow offcanvas')) {
				$('body').removeClass('overflow offcanvas');
			} else {
				$('body').addClass('overflow offcanvas');
			}
			$this.toggleClass('active');
			event.preventDefault();

		});
	};


	var contentWayPoint = function () {
		var i = 0;
		$('.animate-box').waypoint(function (direction) {

			if (direction === 'down' && !$(this.element).hasClass('animated-fast')) {

				i++;

				$(this.element).addClass('item-animate');
				setTimeout(function () {

					$('body .animate-box.item-animate').each(function (k) {
						var el = $(this);
						setTimeout(function () {
							var effect = el.data('animate-effect');
							if (effect === 'fadeIn') {
								el.addClass('fadeIn animated-fast');
							} else if (effect === 'fadeInLeft') {
								el.addClass('fadeInLeft animated-fast');
							} else if (effect === 'fadeInRight') {
								el.addClass('fadeInRight animated-fast');
							} else {
								el.addClass('fadeInUp animated-fast');
							}

							el.removeClass('item-animate');
						}, k * 200, 'easeInOutExpo');
					});

				}, 100);

			}

		}, { offset: '85%' });
	};


	var dropdown = function () {

		$('.has-dropdown').mouseenter(function () {

			var $this = $(this);
			$this
				.find('.dropdown')
				.css('display', 'block')
				.addClass('animated-fast fadeInUpMenu');

		}).mouseleave(function () {
			var $this = $(this);

			$this
				.find('.dropdown')
				.css('display', 'none')
				.removeClass('animated-fast fadeInUpMenu');
		});

	};


	var goToTop = function () {

		$('.js-gotop').on('click', function (event) {

			event.preventDefault();

			$('html, body').animate({
				scrollTop: $('html').offset().top
			}, 500, 'easeInOutExpo');

			return false;
		});

		$(window).scroll(function () {

			var $win = $(window);
			if ($win.scrollTop() > 200) {
				$('.js-top').addClass('active');
			} else {
				$('.js-top').removeClass('active');
			}

		});

	};


	// Loading page
	var loaderPage = function () {
		$(".global-loader").fadeOut("slow");
	};


	var parallax = function () {

		if (!isMobile.any()) {
			$(window).stellar({
				horizontalScrolling: false,
				hideDistantElements: false,
				responsive: true

			});
		}
	};

	// Owl Carousel
	var owlCrouselFeatureSlide = function () {
		var owl = $('.owl-carousel1');
		owl.owlCarousel({
			animateOut: 'fadeOut',
			animateIn: 'fadeIn',
			autoplay: true,
			items: 1,
			loop: true,
			margin: 0,
			responsiveClass: true,
			nav: true,
			dots: false,
			autoplayHoverPause: true,
			smartSpeed: 500,
			navText: [
				"<i class='icon-arrow-left3 owl-direction'></i>",
				"<i class='icon-arrow-right3 owl-direction'></i>"
			]
		});

	};


	$(function () {
		mobileMenuOutsideClick();
		offcanvasMenu();
		burgerMenu();
		contentWayPoint();
		dropdown();
		goToTop();
		loaderPage();
		parallax();
		owlCrouselFeatureSlide();
	});


}());

$(document).ready(($) => {
    "use strict";

    let lazyImages = [].slice.call(document.querySelectorAll("img.lazy"));
    let active = false;

    const lazyLoad = function () {
        if (active === false) {
            active = true;

            setTimeout(function () {
                lazyImages.forEach(function (lazyImage) {
                    if ((lazyImage.getBoundingClientRect().top <= window.innerHeight
                        && lazyImage.getBoundingClientRect().bottom >= 0)
                        && getComputedStyle(lazyImage).display !== "none") {
                            lazyImage.src = lazyImage.dataset.src;
                            lazyImage.srcset = lazyImage.dataset.srcset;
                            lazyImage.classList.remove("lazy");

                            lazyImages = lazyImages.filter(function (image) {
                                return image !== lazyImage;
                            });

                            if (lazyImages.length === 0) {
                                document.removeEventListener("scroll", lazyLoad);
                                window.removeEventListener("resize", lazyLoad);
                                window.removeEventListener("orientationchange", lazyLoad);
                            }
                    }
                });

                active = false;
            }, 200);
        }
    };
    console.log(lazyImages);

    document.addEventListener("scroll", lazyLoad);
    window.addEventListener("resize", lazyLoad);
    window.addEventListener("orientationchange", lazyLoad);


    $('#appDate').datepicker({
        dateFormat: 'dd/mm/yy',
        minDate: 0,
        onSelect: function (dateText) {
            //console.log("Selected date: " + dateText + ", Current Selected Value= " + this.value);
            const photoType = $('#formAppointment #appType option:selected');
            if (photoType.val() != 0) {
                getAvailableHoursInDay(dateText, photoType.val());
            }
            else {
                swal({
                    title: 'Uyarı',
                    text: "Randevu alabileceğiniz saatleri görmeniz için lütfen 'Çekim Türü' seçimi yapınız.",
                    type: "warning",
                    showCancelButton: false,
                    confirmButtonText: 'Tamam'
                });
            }
        }
    });

    $('#formAppointment').submit((event) => {

        event.preventDefault();
        const formId = '#formAppointment';
        const appointment = {
            Name: $(formId + ' #appName').val(),
            Email: $(formId + ' #appEmail').val(),
            Phone: $(formId + ' #appPhone').val(),
            ShootTypeId: $(formId + ' #appType option:selected').val(),
            //Date: $(formId + ' #appDate').val(),
            //DateHourStart: $(formId + ' #appDateHour option:selected').data('start'),
            //DateHourEnd: $(formId + ' #appDateHour option:selected').data('end'),
            Message: $(formId + ' #appMessage').val(),
            ScheduleId: $(formId + ' #appDateHour option:selected').val()
        }
        if (appointment.ScheduleId <= 0) {
            alert("Hata");
            return;
        }
        let formData = new FormData();
        for (let key in appointment) {
            formData.append(key, appointment[key]);
        }
        toggleGlobalLoader(1);

        Api.addAppointment(formData)
            .then(res => {
                if (res.status >= 200 && res.status < 300) {
                    toggleGlobalLoader(0);

                    swal({
                        title: 'Başarılı!',
                        text: res.data,
                        type: "success",
                        showCancelButton: false,
                        confirmButtonText: 'Tamam'
                    }, (isConfirm) => {
                        $(formId)[0].reset();
                    });
                }
            }).catch(err => {
                toggleGlobalLoader(0);

                swal({
                    title: 'Başarısız!',
                    text: error.response.data,
                    type: "warning",
                    showCancelButton: false,
                    confirmButtonText: 'Tamam'
                });
            });

    });

    $('#formContact').submit((event) => {

        event.preventDefault();

        const formId = '#formContact';

        const formData = $(formId).serialize();

        toggleGlobalLoader(1);

        Api.sendContactRequest(formData)
            .then(res => {

                toggleGlobalLoader(0);

                swal({
                    title: 'Başarılı!',
                    text: res.data,
                    type: "success",
                    showCancelButton: false,
                    confirmButtonText: 'Tamam'
                }, (isConfirm) => {
                    $(formId)[0].reset();

                });

            }).catch(error => {
                toggleGlobalLoader(0);

                swal({
                    title: 'Başarısız!',
                    text: error.response.data,
                    type: "warning",
                    showCancelButton: false,
                    confirmButtonText: 'Tamam'
                });
            });

    });

    $('#formAppointment #appType').change(function () {
        const date = $('#formAppointment #appDate').val();
        const appType = $(this).val();
        if (date && appType != 0) {
            getAvailableHoursInDay(date, appType);
        }
    });
    $("#appPhone").inputmask({ "mask": "(999) 999-9999" });
    $("#contactPhone").inputmask({ "mask": "(999) 999-9999" });
});


const getAvailableHoursInDay = (date, photoType) => {

    const appDateHour = $('#appDateHour');
    appDateHour.attr('disabled', true);
    toggleGlobalLoader(1);
    Api.getSchedules(date, '', photoType)
        .then(res => {

            toggleGlobalLoader(0);

            if (res.status >= 200 && res.status < 300) {
                const data = res.data;
                appDateHour.removeAttr('disabled');
                appDateHour.empty();
                appDateHour.append('<option value="-1">Randevu Saati</option>')
                for (let i = 0; i < data.length; i++) {
                    appDateHour.append(`<option data-start="${data[i].startHour}" data-end="${data[i].endHour}" value="${data[i].id}">` +
                        `${data[i].startHour} - ${data[i].endHour}</option>`)
                }
                if (data.length == 0) {
                    swal({
                        title: 'Üzgünüz :(',
                        text: `Maalesef ${date} tarihi için uygun randevu saati yok. Dilerseniz başka tarihlere bakabilir veya daha detaylı bilgi için bizim ile iletişime geçebilirsiniz.`,
                        type: "info",
                        showCancelButton: false,
                        confirmButtonText: 'Tamam'
                    });
                }
            }
        })
        .catch(err => {
            toggleGlobalLoader(0);
            console.log(err.response.data);
        });

}
const UPLOAD_STATUS_UPLOAD_STARTED = 'upload-stated';
const UPLOAD_STATUS_UPLOAD_ENDED = 'upload-ended';
const UPLOAD_STATUS_UPLOAD_ERROR = 'upload-error';
const UPLOAD_STATUS_UPLOAD_PROGRESS = 'upload-progress';

function makeXMLHttpRequest(url, data, callback) {
    var request = new XMLHttpRequest();
    request.onreadystatechange = function () {
        if (request.readyState === 4) {
            if (request.status === 200) {
                callback(UPLOAD_STATUS_UPLOAD_ENDED, request.response);
            } else {
                callback(UPLOAD_STATUS_UPLOAD_ERROR, "Istenmeyen cevap " + request.status);
            }
        }
    };

    request.upload.onloadstart = function () {
        callback(UPLOAD_STATUS_UPLOAD_STARTED);
    };

    request.upload.onprogress = function (event) {
        callback(UPLOAD_STATUS_UPLOAD_PROGRESS, event);
    };


    request.upload.onerror = function (error) {
        callback(UPLOAD_STATUS_UPLOAD_ERROR, error);
    };

    request.onloadend = function () {
        if (request.status === 404) {
            callback(UPLOAD_STATUS_UPLOAD_ERROR, "Istenmeyen cevap " + request.status);
        }
    };

    request.open('POST', url);
    request.setRequestHeader('X-CSRFToken', csrftoken);
    try {
        request.send(data);
    } catch (e) {
        callback(UPLOAD_STATUS_UPLOAD_ERROR, "Istenmeyen cevap");
        console.log(e);
    }

}


axios.defaults.headers.common = {
    'X-Requested-With': 'XMLHttpRequest',
    //'X-CSRFToken': csrftoken,
    'Content-Type': 'application/x-www-form-urlencoded'
};

function getData(url, data) {
    return axios.get(url, {
        params: data
    });
}

function postData(url = ``, data = {}, options = {}) {
    return axios.post(url, data, options);
}

